(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[78903],{991361:function(e,n,o){"use strict";o.r(n),o.d(n,{default:function(){return u}});var t={};o.r(t),o.d(t,{demoComponents:function(){return l},demos:function(){return r},docs:function(){return i},srcComponents:function(){return c}});var a=o(778521);o(470079);var s=o(602554),i={en:{description:"You will lead the development of the MUI\xa0X Data Grid, positioning the component as the next industry standard.",location:"/docs/pages/careers/react-tech-lead-x-grid.md",rendered:['<svg style="display: none;" xmlns="http://www.w3.org/2000/svg">\n      <symbol id="error-icon" viewBox="0 0 20 20">\n      <path fill-rule="evenodd" d="M2 7.4v5.2a2 2 0 0 0 .586 1.414l3.4 3.4A2 2 0 0 0 7.4 18h5.2a2 2 0 0 0 1.414-.586l3.4-3.4A2 2 0 0 0 18 12.6V7.4a2 2 0 0 0-.586-1.414l-3.4-3.4A2 2 0 0 0 12.6 2H7.4a2 2 0 0 0-1.414.586l-3.4 3.4A2 2 0 0 0 2 7.4Zm11.03-.43a.75.75 0 0 1 0 1.06L11.06 10l1.97 1.97a.75.75 0 1 1-1.06 1.06L10 11.06l-1.97 1.97a.75.75 0 0 1-1.06-1.06L8.94 10 6.97 8.03a.75.75 0 0 1 1.06-1.06L10 8.94l1.97-1.97a.75.75 0 0 1 1.06 0Z" clip-rule="evenodd"/>\n      </symbol>\n      </svg>','<svg style="display: none;" xmlns="http://www.w3.org/2000/svg">\n      <symbol id="warning-icon" viewBox="0 0 20 20">\n      <path d="M2.33 17a.735.735 0 0 1-.665-.375.631.631 0 0 1-.094-.375.898.898 0 0 1 .115-.396L9.353 3.062a.621.621 0 0 1 .281-.27.85.85 0 0 1 .729 0 .622.622 0 0 1 .281.27l7.667 12.792c.07.125.108.257.114.396a.63.63 0 0 1-.093.375.842.842 0 0 1-.271.27.728.728 0 0 1-.394.105H2.33Zm7.664-2.5c.211 0 .39-.072.536-.214a.714.714 0 0 0 .218-.532.736.736 0 0 0-.214-.535.714.714 0 0 0-.531-.22.736.736 0 0 0-.536.215.714.714 0 0 0-.219.531c0 .212.072.39.215.536.143.146.32.219.531.219Zm0-2.5c.211 0 .39-.072.536-.216a.72.72 0 0 0 .218-.534v-2.5a.728.728 0 0 0-.214-.534.72.72 0 0 0-.531-.216.734.734 0 0 0-.536.216.72.72 0 0 0-.219.534v2.5c0 .212.072.39.215.534a.72.72 0 0 0 .531.216Z"/>\n      </symbol>\n      </svg>','<svg style="display: none;" xmlns="http://www.w3.org/2000/svg">\n      <symbol id="success-icon" viewBox="0 0 20 20">\n      <path d="m8.938 10.875-1.25-1.23a.718.718 0 0 0-.521-.228.718.718 0 0 0-.521.229.73.73 0 0 0 0 1.062l1.77 1.771c.153.153.327.23.521.23a.718.718 0 0 0 .521-.23l3.896-3.896a.73.73 0 0 0 0-1.062.718.718 0 0 0-.52-.23.718.718 0 0 0-.521.23l-3.376 3.354ZM10 18a7.796 7.796 0 0 1-3.104-.625 8.065 8.065 0 0 1-2.552-1.719 8.064 8.064 0 0 1-1.719-2.552A7.797 7.797 0 0 1 2 10c0-1.111.208-2.15.625-3.115a8.064 8.064 0 0 1 4.27-4.26A7.797 7.797 0 0 1 10 2c1.111 0 2.15.208 3.115.625a8.096 8.096 0 0 1 4.26 4.26C17.792 7.851 18 8.89 18 10a7.797 7.797 0 0 1-.625 3.104 8.066 8.066 0 0 1-4.26 4.271A7.774 7.774 0 0 1 10 18Z"/>\n      </symbol>\n      </svg>','<svg style="display: none;" xmlns="http://www.w3.org/2000/svg">\n      <symbol id="info-icon" viewBox="0 0 20 20">\n      <path d="M9.996 14c.21 0 .39-.072.535-.216a.72.72 0 0 0 .219-.534v-3.5a.728.728 0 0 0-.214-.534.72.72 0 0 0-.532-.216.734.734 0 0 0-.535.216.72.72 0 0 0-.219.534v3.5c0 .213.071.39.214.534a.72.72 0 0 0 .532.216Zm0-6.5c.21 0 .39-.071.535-.214a.714.714 0 0 0 .219-.532.736.736 0 0 0-.214-.535.714.714 0 0 0-.532-.219.736.736 0 0 0-.535.214.714.714 0 0 0-.219.532c0 .21.071.39.214.535.143.146.32.219.532.219Zm.01 10.5a7.81 7.81 0 0 1-3.11-.625 8.065 8.065 0 0 1-2.552-1.719 8.066 8.066 0 0 1-1.719-2.551A7.818 7.818 0 0 1 2 9.99c0-1.104.208-2.14.625-3.105a8.066 8.066 0 0 1 4.27-4.26A7.818 7.818 0 0 1 10.009 2a7.75 7.75 0 0 1 3.106.625 8.083 8.083 0 0 1 4.26 4.265A7.77 7.77 0 0 1 18 9.994a7.81 7.81 0 0 1-.625 3.11 8.066 8.066 0 0 1-1.719 2.552 8.083 8.083 0 0 1-2.546 1.719 7.77 7.77 0 0 1-3.104.625Z"/>\n      </symbol>\n      </svg>','\n      <svg style="display: none;" xmlns="http://www.w3.org/2000/svg">\n      <symbol id="copied-icon" viewBox="0 0 24 24">\n        <path d="M20 2H8c-1.1 0-2 .9-2 2v12c0 1.1.9 2 2 2h12c1.1 0 2-.9 2-2V4c0-1.1-.9-2-2-2zm-8.24 11.28L9.69 11.2c-.38-.39-.38-1.01 0-1.4.39-.39 1.02-.39 1.41 0l1.36 1.37 4.42-4.46c.39-.39 1.02-.39 1.41 0 .38.39.38 1.01 0 1.4l-5.13 5.17c-.37.4-1.01.4-1.4 0zM3 6c-.55 0-1 .45-1 1v13c0 1.1.9 2 2 2h13c.55 0 1-.45 1-1s-.45-1-1-1H5c-.55 0-1-.45-1-1V7c0-.55-.45-1-1-1z" />\n      </symbol>\n      </svg>','<svg style="display: none;" xmlns="http://www.w3.org/2000/svg">\n      <symbol id="copy-icon" viewBox="0 0 24 24">\n      <path d="M15 20H5V7c0-.55-.45-1-1-1s-1 .45-1 1v13c0 1.1.9 2 2 2h10c.55 0 1-.45 1-1s-.45-1-1-1zm5-4V4c0-1.1-.9-2-2-2H9c-1.1 0-2 .9-2 2v12c0 1.1.9 2 2 2h9c1.1 0 2-.9 2-2zm-2 0H9V4h9v12z" />\n      +</symbol>\n      </svg>','<svg style="display: none;" xmlns="http://www.w3.org/2000/svg">\n        <symbol id="anchor-link-icon" viewBox="0 0 12 6">\n          <path d="M8.9176 0.083252H7.1676C6.84677 0.083252 6.58427 0.345752 6.58427 0.666585C6.58427 0.987419 6.84677 1.24992 7.1676 1.24992H8.9176C9.8801 1.24992 10.6676 2.03742 10.6676 2.99992C10.6676 3.96242 9.8801 4.74992 8.9176 4.74992H7.1676C6.84677 4.74992 6.58427 5.01242 6.58427 5.33325C6.58427 5.65409 6.84677 5.91659 7.1676 5.91659H8.9176C10.5276 5.91659 11.8343 4.60992 11.8343 2.99992C11.8343 1.38992 10.5276 0.083252 8.9176 0.083252ZM3.6676 2.99992C3.6676 3.32075 3.9301 3.58325 4.25094 3.58325H7.75094C8.07177 3.58325 8.33427 3.32075 8.33427 2.99992C8.33427 2.67909 8.07177 2.41659 7.75094 2.41659H4.25094C3.9301 2.41659 3.6676 2.67909 3.6676 2.99992ZM4.83427 4.74992H3.08427C2.12177 4.74992 1.33427 3.96242 1.33427 2.99992C1.33427 2.03742 2.12177 1.24992 3.08427 1.24992H4.83427C5.1551 1.24992 5.4176 0.987419 5.4176 0.666585C5.4176 0.345752 5.1551 0.083252 4.83427 0.083252H3.08427C1.47427 0.083252 0.167603 1.38992 0.167603 2.99992C0.167603 4.60992 1.47427 5.91659 3.08427 5.91659H4.83427C5.1551 5.91659 5.4176 5.65409 5.4176 5.33325C5.4176 5.01242 5.1551 4.74992 4.83427 4.74992Z" />\n        </symbol>\n    </svg>','<svg style="display: none;" xmlns="http://www.w3.org/2000/svg">\n      <symbol id="comment-link-icon" viewBox="0 0 24 24">\n      <path d="M22.8481 4C22.8481 2.9 21.9481 2 20.8481 2H4.84814C3.74814 2 2.84814 2.9 2.84814 4V16C2.84814 17.1 3.74814 18 4.84814 18H18.8481L22.8481 22V4ZM16.8481 11H13.8481V14C13.8481 14.55 13.3981 15 12.8481 15C12.2981 15 11.8481 14.55 11.8481 14V11H8.84814C8.29814 11 7.84814 10.55 7.84814 10C7.84814 9.45 8.29814 9 8.84814 9H11.8481V6C11.8481 5.45 12.2981 5 12.8481 5C13.3981 5 13.8481 5.45 13.8481 6V9H16.8481C17.3981 9 17.8481 9.45 17.8481 10C17.8481 10.55 17.3981 11 16.8481 11Z" />\n      </symbol>\n      </svg>','<h1>React Tech Lead — xGrid</h1><p class="description">You will lead the development of the MUI\xa0X Data Grid, positioning the component as the next industry standard.</p>\n\n<h2 id="details-of-the-role"><a href="#details-of-the-role" class="title-link-to-anchor">Details of the role<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="details-of-the-role"><svg><use xlink:href="#comment-link-icon" /></svg></button></h2><ul>\n<li><strong>Location</strong>: Remote (preference for UTC-6 to UTC+5).</li>\n<li><strong>Type of work</strong>: Full-time (contractor or employee <a href="https://mui-org.notion.site/Hiring-FAQ-64763b756ae44c37b47b081f98915501#494af1f358794028beb4b7697b5d3102">depending on circumstances</a>).</li>\n<li><strong>Level</strong>: <a href="https://mui-org.notion.site/Engineering-levels-25b2fba9dd1f4b43a1b28f47f0170f23">6 or above</a>.</li>\n<li>We&#39;re a <strong>remote</strong> company, we prefer asynchronous communication over meetings.</li>\n</ul>\n<h2 id="the-company"><a href="#the-company" class="title-link-to-anchor">The company<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="the-company"><svg><use xlink:href="#comment-link-icon" /></svg></button></h2><p>MUI&#39;s story began in 2014 with Material\xa0UI, the most successful React implementation of Google&#39;s Material Design.\nToday, Material\xa0UI stands as one of the most popular open-source libraries on GitHub and has paved the way for the fully-fledged startup known as MUI (founded in 2019), which now boasts an ever-expanding ecosystem of React UI products.\nWe&#39;re a company of 31+ people as of late 2023, and we&#39;re growing.</p>\n<h2 id="the-products"><a href="#the-products" class="title-link-to-anchor">The products<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="the-products"><svg><use xlink:href="#comment-link-icon" /></svg></button></h2><p>MUI is best known for our flagship product, Material\xa0UI—but this is just one of three core component libraries we maintain.\nBase\xa0UI is our headless component library, and Joy\xa0UI is a sister library to Material\xa0UI that implements our own in-house Joy Design system.\nWe also host Design Kits and pre-built Templates.</p>\n<p>Beyond the core libraries, MUI\xa0X offers advanced components like the Data Grid, Date and Time Pickers, and Charts, for more complex user interactions and data visualization needs.</p>\n<p>We&#39;re also making ambitious moves to incorporate our full suite of components into Toolpad, a low-code admin builder tool for assembling full-stack apps faster than ever.</p>\n<p>Learn more about MUI&#39;s products in this blog post: <a href="https://mui.com/blog/mui-product-comparison/">An introduction to the MUI ecosystem</a>.</p>\n<h2 id="the-culture"><a href="#the-culture" class="title-link-to-anchor">The culture<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="the-culture"><svg><use xlink:href="#comment-link-icon" /></svg></button></h2><p>MUI is a fully remote company with a team that spans the globe.\nThe majority of our work is asynchronous, and we rely on written communication to collaborate.\nWe&#39;re radically transparent: nearly all of our work happens in public.\nEach contributor has the freedom to decide how and when they work, and that work is primarily self-directed: it&#39;s your responsibility to define and complete your own tasks in a timely manner.</p>\n<p>For additional details about the culture, you can check our <a href="https://mui.com/careers/">careers</a> and <a href="https://mui.com/about/">about</a> pages and also our <a href="https://mui-org.notion.site/Handbook-f086d47e10794d5e839aef9dc67f324b">public Handbook</a>.</p>\n<h2 id="why-were-hiring"><a href="#why-were-hiring" class="title-link-to-anchor">Why we&#39;re hiring<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="why-were-hiring"><svg><use xlink:href="#comment-link-icon" /></svg></button></h2><p>The data grid team (part of MUI\xa0X) needs your help.\nThe component is off <a href="https://npm-stat.com/charts.html?package=%40mui%2Fx-data-grid&package=react-table&package=ag-grid-community&from=2021-06-01">a great start</a>, however we have only started to scratch the surface for the potential of this component. There is x10 more to build.\nWe need to:</p>\n<ul>\n<li>build an headless version for Base\xa0UI.</li>\n<li>build advanced, in browsers, data analysis features like pivoting and charts integration.</li>\n<li>build a strong integration with backend APIs, for example to handle &gt;100M rows.</li>\n</ul>\n<p>We also need help to continue to make the components easier to use, make it more customizable, <a href="https://www.causal.app/blog/react-perf">improve performance</a>, make it more accessible, improve the health of the open-source by engaging and collaborating with the community, guide developers to answers, and just generally being a positive presence in the community.</p>\n<p>Overall, both our open-source community and our premium products are growing fast (x2 YoY).\nWe need talented people to keep that going!</p>\n<h2 id="the-role"><a href="#the-role" class="title-link-to-anchor">The role<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="the-role"><svg><use xlink:href="#comment-link-icon" /></svg></button></h2><h3 id="why-this-is-interesting"><a href="#why-this-is-interesting" class="title-link-to-anchor">Why this is interesting<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="why-this-is-interesting"><svg><use xlink:href="#comment-link-icon" /></svg></button></h3><p>The advanced components portfolio is still small, with a million interesting and challenging problems to solve.</p>\n<p>Our products empower React developers to build awesome applications faster – we see millions of developers on MUI&#39;s docs every year, one million a month.</p>\n<h3 id="what-youll-do-on-a-day-to-day-basis"><a href="#what-youll-do-on-a-day-to-day-basis" class="title-link-to-anchor">What you&#39;ll do on a day-to-day basis<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="what-youll-do-on-a-day-to-day-basis"><svg><use xlink:href="#comment-link-icon" /></svg></button></h3><p>You will extend the <a href="https://mui-org.notion.site/Software-Engineer-fe310cfb22e34fc7881318f9cb1cf023#5f2967e6c60d411ea09ab8a108d95702">React Engineer</a> responsibilities. Depending on the day, you&#39;ll:</p>\n<ul>\n<li><strong>Lead</strong>. You will lead by inspiring and setting the bar for code quality for the engineering team, and cracking the hard problems:<ul>\n<li>Guide the approach and execution.</li>\n<li>Guide people in making the right technical decisions themselves over imposing them.</li>\n<li>Be aware of the current technical landscape and knows where the wind blows.</li>\n</ul>\n</li>\n<li><strong>Nurture community contributions</strong>. You will provide guidance and direction to unlock the contributions of the community. Your time will often be way better spent doing this than fixing the problems yourself.</li>\n<li><strong>Shape the product</strong>. You will be laser-focused on the end goal. It&#39;s not about solving technical challenges but about the problem solved for the users.</li>\n<li><strong>Enable quality work</strong>. You will:<ul>\n<li>Embody and foster the engineering culture, for example rigorousness, push for small single-purpose PRs, encourage peer reviews, create strong feedback loops between decision and outcome.</li>\n<li>Empower the team to aim for high-quality outputs. By doing such it aims for the success of delivered solutions.</li>\n<li>Push for consistency, follow what&#39;s going on in the other teams.</li>\n</ul>\n</li>\n<li><strong>Keep technical debt in check</strong>. You will make sure we can keep shipping features at a reasonable pace, align the team on &quot;one way&quot; of doing things and make sure engineers follow the conventions.</li>\n<li><strong>Be a solver</strong>. You will dig deep into arbitrarily complex problems and find an appropriate path forward. Some focus on a given area for long periods, others bounce from hotspot to hotspot as guided by organizational leadership.</li>\n</ul>\n<h3 id="the-best-parts-of-this-job"><a href="#the-best-parts-of-this-job" class="title-link-to-anchor">The best parts of this job<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="the-best-parts-of-this-job"><svg><use xlink:href="#comment-link-icon" /></svg></button></h3><ul>\n<li><strong>You&#39;ll be at the cutting edge of application development</strong> — working on one of the fastest-growing UI libraries on the market.</li>\n<li><strong>You&#39;ll be part of an active, open, friendly community</strong> of developers that are excited about building awesome applications.</li>\n<li><strong>Your role will be key to making MUI the go-to UI solution</strong> for building applications, websites, and design systems with React.</li>\n</ul>\n<h3 id="the-worst-parts-of-this-job"><a href="#the-worst-parts-of-this-job" class="title-link-to-anchor">The worst parts of this job<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="the-worst-parts-of-this-job"><svg><use xlink:href="#comment-link-icon" /></svg></button></h3><ul>\n<li><strong>Shifting context.</strong>\nYou will necessarily have to shift context and dive into a different feature before the current one is done.\nIt may even be in an area of the codebase you&#39;re unfamiliar with or don&#39;t have a ton of understanding about.\nIt&#39;s fun, rewarding work, but it can be very challenging.</li>\n<li><strong>We move quickly, but don&#39;t sacrifice quality</strong>.\nWe ship early, often, and quickly. You may not be initially comfortable with the cadence with which we ship high-quality features and improvements to end-users. By doing so, we sacrifice on solving each problem 100% in exchange for fast feedback. Solving 50-70% of the issue with quality should be enough for any given iteration. Our users quickly tell us when we haven&#39;t pushed a solution far enough.</li>\n<li><strong>MUI has a large codebase</strong>. You may bang your head against the wall at times, and then write tests to assist future you \uD83D\uDE0C.\nThe work you will be doing is somewhat unique and idiosyncratic. You probably have not had a similar role before.</li>\n<li><strong>In open-source, you&#39;re faced with a nonstop stream of bug reports and support requests</strong>. That means you need to develop an intuition for when to ignore something, and when to dig in further.</li>\n</ul>\n<h2 id="who-were-looking-for"><a href="#who-were-looking-for" class="title-link-to-anchor">Who we&#39;re looking for<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="who-were-looking-for"><svg><use xlink:href="#comment-link-icon" /></svg></button></h2><p>We&#39;re looking for someone with strong front-end skills. More important than specific technical skills though is that you&#39;re a strong problem solver who loves to learn. Details matter to you.</p>\n<h3 id="required"><a href="#required" class="title-link-to-anchor">Required<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="required"><svg><use xlink:href="#comment-link-icon" /></svg></button></h3><ul>\n<li><strong>Expertise in the modern JavaScript ecosystem</strong>.\nMUI&#39;s open-source projects are built on the shoulders of giants, making use of technologies such as ES2021, TypeScript, Node.js, React, Next.js, Webpack, and Babel.</li>\n<li><strong>A track record of demonstrating an eye for product and solving real-world user problems</strong>. If you have a knack for solving problems at the root cause, shipping beautiful user interfaces and intuitive APIs, we want you on our team.</li>\n<li><strong>Experience building and shipping production code in a team setting</strong> with a passion for writing tested, performant, and high-quality code.</li>\n<li><strong>Strong written and verbal communication skills</strong>.\nAs part of the team, you&#39;ll interface both directly and indirectly with community members and enterprise customers, and contribute to user documentation. Clear communication is fundamental in creating intuitive and compelling resources.</li>\n<li><strong>Ability to dive into complex problems</strong>.\nYou should be able to quickly assess, understand, and iterate upon aspects of our codebase.</li>\n<li><strong>Ready and willing to ask and answer questions</strong>.\nIf you&#39;re comfortable saying you&#39;re unsure, asking for help; but equally reaching out to assist others, you&#39;ll be an incredible addition to our team. We thrive because of continuous learning. First-time mistakes should be celebrated, not blamed.</li>\n<li><strong>Avoid monolithic deliverables</strong>.\nYou scope and stage your work into well-defined milestones to ship.</li>\n<li><strong>Past work with front-end infrastructure</strong>.\nPerhaps you&#39;ve created your company&#39;s design system, written a Babel plugin, or written complex React components.\nIt would be great if you could address this in your cover letter!</li>\n</ul>\n<h3 id="nice-to-have-but-not-required"><a href="#nice-to-have-but-not-required" class="title-link-to-anchor">Nice to have (but not required)<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="nice-to-have-but-not-required"><svg><use xlink:href="#comment-link-icon" /></svg></button></h3><ul>\n<li><strong>You&#39;ve contributed to a design system before</strong>.\nYou have worked on enterprise components in the past, maybe for internal use in your company.\nYou have built complex and advanced features while making sure the accessibility was fully functional.</li>\n<li><strong>You&#39;ve maintained an active repository before</strong>.\nMaybe you&#39;ve helped maintain a popular open-source repository, or perhaps you&#39;ve worked on internal repositories that saw contributions from multiple teams.\nPrevious experience with highly active repository workflows is a definite plus for this role.</li>\n<li><strong>You have contributed code</strong>. A history of contributing to MUI&#39;s open-source projects is a plus.</li>\n</ul>\n<h2 id="benefits-and-compensation"><a href="#benefits-and-compensation" class="title-link-to-anchor">Benefits and compensation<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="benefits-and-compensation"><svg><use xlink:href="#comment-link-icon" /></svg></button></h2><p>Competitive compensation depending on the profile and location.\nWe are ready to pay top market rates for a person that can clearly exceed the role&#39;s expectations.\nYou can find the other perks &amp; benefits on the <a href="https://mui.com/careers/#perks-and-benefits">careers</a> page.</p>\n<h2 id="how-to-apply"><a href="#how-to-apply" class="title-link-to-anchor">How to apply<span class="anchor-icon"><svg><use xlink:href="#anchor-link-icon" /></svg></span></a><button title="Post a comment" class="comment-link" data-feedback-hash="how-to-apply"><svg><use xlink:href="#comment-link-icon" /></svg></button></h2><p><a href="https://jobs.ashbyhq.com/MUI/dffc8ead-fab1-4a07-8b44-a932e2838e0e/application?utm_source=ZNRrPGBkqO">Apply now for this position \uD83D\uDCEE</a></p>\n<p>Don&#39;t meet every requirement?\nApply anyway!\nResearch shows that certain folks are less likely to apply for a role than others <a href="https://hbr.org/2014/08/why-women-dont-apply-for-jobs-unless-theyre-100-qualified">unless they meet 100%</a> of the outlined qualifications.\nIf this role excites you, we want to hear from you.\nWe&#39;d love for you to share the unique skills, passion, and experience you could bring to MUI.</p>\n'],toc:[{text:"Details of the role",level:2,hash:"details-of-the-role",children:[]},{text:"The company",level:2,hash:"the-company",children:[]},{text:"The products",level:2,hash:"the-products",children:[]},{text:"The culture",level:2,hash:"the-culture",children:[]},{text:"Why we&#39;re hiring",level:2,hash:"why-were-hiring",children:[]},{text:"The role",level:2,hash:"the-role",children:[{text:"Why this is interesting",level:3,hash:"why-this-is-interesting"},{text:"What you&#39;ll do on a day-to-day basis",level:3,hash:"what-youll-do-on-a-day-to-day-basis"},{text:"The best parts of this job",level:3,hash:"the-best-parts-of-this-job"},{text:"The worst parts of this job",level:3,hash:"the-worst-parts-of-this-job"}]},{text:"Who we&#39;re looking for",level:2,hash:"who-were-looking-for",children:[{text:"Required",level:3,hash:"required"},{text:"Nice to have (but not required)",level:3,hash:"nice-to-have-but-not-required"}]},{text:"Benefits and compensation",level:2,hash:"benefits-and-compensation",children:[]},{text:"How to apply",level:2,hash:"how-to-apply",children:[]}],title:"React Tech Lead — xGrid",headers:{components:[]}}},r={};r.scope={process:{},import:{}};var l={},c={},h=o(735250);function u(){return(0,h.jsx)(s.Z,(0,a.Z)({},t))}},251662:function(e,n,o){(window.__NEXT_P=window.__NEXT_P||[]).push(["/careers/react-tech-lead-x-grid",function(){return o(991361)}])}},function(e){e.O(0,[49774,9535,73976,97146,59727,85925,56831,22274,89068,48003,45678,31082,39987,71427,75794,53301,66215,37654,83030,95998,92888,40179],function(){return e(e.s=251662)}),_N_E=e.O()}]);